// import img from "./image/b2.jpg"
// import img2 from "./image/d1.jpg"
import { NavLink } from "react-router-dom";

const App = () => {

  return (
    <>
    <div className="links">
    <NavLink to="/" target="_blank" rel="noreferrer">
                            <span className="tooltip">linkedIn
                            </span>
                            <i className="fab fa-linkedin-in" aria-hidden="true"></i>
                         </NavLink>
    </div>
    </>
  );
}

export default App;
